const url = process.env.BACK_END_URL || "http://localhost:8000";

export function getTrades(token) {
    console.log(token);
    var myHeaders = new Headers({
        Authorization: "Token " + token,
        "Content-Type": "application/json",
    });

    fetch(`${url}}/tracker/`, {
        headers: myHeaders,
        method: "GET",
    })
        .then((res) => res.json())
        .catch((error) => {
            console.error("Error:", error);
        })
        .then((result) => {
            return result;
        });
}
